import React from "react";
import { useState } from "react";

const App = () => {
  const [num, setNum] = useState(0);

  const Increase = () => {
    console.log("clicked");
    setNum(num + 5);
  };

  const Decrease = () => {
    setNum(num - 1);
  };

  return (
    <>
      <div style={{ textAlign: "center" }}>
        <h1>Increment Decrement Challenge</h1>
        <h1>{num}</h1>
        <button onClick={Increase}>+</button>
        <button onClick={Decrease}>-</button>
      </div>
    </>
  );
};

export default App;
